	const [allData, setAllData] = useState(null);
	useEffect(() => {
		async function fetch() {
			const data = await axios.get('http://www.omdbapi.com/', {
				params: {
					apikey: ApiKey,
					s: 'avengers',
				},
			});
			fetch();
			setAllData(data);
		}
	}, []);

	console.log(allData);

